import React, { Component } from 'react';

export default class Login extends Component{
    render(){
        return(<div>
            <div>
                <form action="/login" method="POST">
                    <input type="email" placeholder="Email" maxlength="100" name="email" className="form-control"/>
                    <input type="password" placeholder="Password" maxlength="16" name="password" className="form-control"/>
                    <input type="Submit" value="Login" className="form-control btn btn-primary"/>
                </form>
                <a href='/Signup'>Create Account</a>
            </div>
        </div>)
    }
}
